import{Delim,Ident}from"../../tokenizer/index.js";const FULLSTOP=46;export const name="ClassSelector";export const structure={name:String};export function parse(){return this.eatDelim(46),{type:"ClassSelector",loc:this.getLocation(this.tokenStart-1,this.tokenEnd),name:this.consume(Ident)}}export function generate(t){this.token(Delim,"."),this.token(Ident,t.name)}